import React from 'react'
import Card from '../card/card'
import './cards.css'

const cards = ({info}) => {
  return (
    <div className='cards-cont'>
        {
          info.map((food)=> <Card image={food.image} title={food.title} diets={food.diets}/>)
            
        }

    </div>
  )
}

export default cards
